import React from "react";
import {
  MDBRow,
  MDBCol,
  MDBInput,
  MDBCheckbox,
  MDBBtn,
} from "mdb-react-ui-kit";
import { useState } from "react";

export default function App() {
  const [formValue, setFormValue] = useState({
    fname: "Mark",
    lname: "Otto",
    email: "",
    city: "",
    state: "",
    zip: "",
  });

  const onSubmitHandler = (event) => {
    event.preventDefault();
    console.log(event);
    console.log("formValueformValue", formValue);
  };
  const onChange = (e) => {
    setFormValue({ ...formValue, [e.target.name]: e.target.value });
  };

  return (
    <form id="form" onSubmit={(e) => onSubmitHandler(e)}>
      <MDBRow className="mb-4">
        <MDBCol>
          <MDBInput id="form6Example1" label="First name" required />
        </MDBCol>
        <MDBCol>
          <MDBInput id="form6Example2" label="Last name" />
        </MDBCol>
      </MDBRow>

      <MDBInput wrapperClass="mb-4" id="form6Example3" label="Company name" />
      <MDBInput wrapperClass="mb-4" id="form6Example4" label="Address" />
      <MDBInput
        wrapperClass="mb-4"
        type="email"
        id="form6Example5"
        label="Email"
        onChange={onSubmitHandler}
      />
      <MDBInput
        wrapperClass="mb-4"
        type="tel"
        id="form6Example6"
        label="Phone"
        onChange={(e) => setFormValue({ phone: e.currentTarget.value })}
      />

      <MDBInput
        wrapperClass="mb-4"
        textarea
        id="form6Example7"
        rows={4}
        label="Additional information"
      />

      <MDBCheckbox
        wrapperClass="d-flex justify-content-center mb-4"
        id="form6Example8"
        label="Create an account?"
        defaultChecked
      />

      <MDBBtn className="mb-4" type="submit" form="form" block>
        Enviar potulaci√≥n
      </MDBBtn>
    </form>
  );
}
